import React from 'react'
import Dashboard from './Dashboard'

const App = () => {
  const dashStyle = {
    display: 'flex',
    alignItems: 'stretch',
  }

  return (
    <>
      <Dashboard style={dashStyle} />
    </>
  )
}

export default App
